$(document).ready(function () {

    /**
     * Toggles the cta-div after scrolling a certain distance
     */
    $(document).scroll(function () {
        checkToggleCta();
    });

    // close the slidein
    $('[data-js=cta-close]').on( 'click', function() {
        closeSlidein();
    });
});

/**
 * Toggles the cta-div after scrolling a certain distance
 */
function checkToggleCta() {
    var y = $(this).scrollTop();
    var ctaElem = $('[data-js="cta-bottom"]');

    if(ctaElem.length == 1) {
        // if user scrolled more than 400
        if (y > 400) {
            ctaElem.fadeIn().css('display', 'flex');
        } else {
            ctaElem.fadeOut();
        }
    }
}

/**
 * Closes the slidein permanently
 */
function closeSlidein() {
    var cta = $('[data-js=cta-bottom]');
    cta.fadeOut(400, function(){
        cta.remove();
    });
}
/**
 * JS for generator
 */

//Same as $(document).ready();
function ready(fn) {
    if (document.readyState != 'loading') {
        fn();
    } else {
        document.addEventListener('DOMContentLoaded', fn);
    }
}

//When the page has loaded, run this code
ready(function () {
    var holder = document.getElementById('filedrop-container');

    if (holder) {
        // prevent default behavior from changing page on dropped file
        holder.ondragover = function (e) {
            e.preventDefault();
            return false
        };
        // NOTE: ondrop events WILL NOT WORK if you do not 'preventDefault' in the ondragover event!!
        holder.ondrop = function (e) {
            e.preventDefault();
            return false
        };

        holder.ondragover = function () {
            $('[data-js=upload-restriction]').hide();
            $('[data-js="fileupload-container"]').hide();

            // Workaround for flickering on dragover
            $('.generator-forms--leave#filedrop-container *').css('pointer-events', 'none');

            this.className = 'generator-forms__wrapper generator-forms--hover';
            return false;
        };
        holder.ondragleave = function () {
            this.className = 'generator-forms__wrapper generator-forms--leave';
            $('[data-js="fileupload-container"]').hide();

            // Workaround for flickering on dragover
            setTimeout(function () {
                $('.generator-forms--leave#filedrop-container *').css('pointer-events', 'unset');
            }, 500);

            return false;
        };

        holder.ondrop = function (e) {
            this.className = 'generator-forms__wrapper';
            e.preventDefault();

            $('#show-restriction-tracker').click();
            $('.generator-forms__wrapper#filedrop-container *').css('pointer-events', 'unset');
            $('[data-js=upload-restriction]').css('display', 'flex');
            $('.generator-navigation__wrapper').hide();
            $('[data-js="fileupload-container"]').hide();

            return false;
        };
    }
});

$( document ).ready(function() {
    $('.generator-forms__wrapper').on( 'click', function() {
        $('.form-control__general-input').focus();
    });
});

