function lazy_load_image() {
	$('img[data-lazy-src]').each(function () {
		if(isScrolledIntoViewport(this)) {
			var $img = jQuery( this ),
				src = $img.attr( 'data-lazy-src' );

			$img.hide()
				.removeAttr( 'data-lazy-src' )
				.attr( 'data-lazy-loaded', 'true' );

			$img.attr('src', src);
			$img.fadeIn();
		}
	})
}

function isScrolledIntoViewport(elem) {
	var docViewTop = $(window).scrollTop() - 500;
	var docViewBottom = docViewTop + $(window).height() + 1000;

	var elemTop = $(elem).offset().top;
	var elemBottom = elemTop + $(elem).height();

	return ((elemBottom <= docViewBottom) && (elemTop >= docViewTop));
}

$(document).ready(function () {
    var navigation = $('[data-js="generator-navigation"] > .tab-container > .nav-tabs');
    createDraggableNavigation(navigation);
});

/**
 * Makes the given Navigation draggable. This means that you can swipe through the navigation tabs horizontally with your mouse.
 */
function createDraggableNavigation(navigation) {
    var x, y, top, left, down;
    var body = $('body');

    navigation.mousedown(function (e) {
        e.preventDefault();
        down = true;
        x = e.pageX;
        y = e.pageY;
        top = $(this).scrollTop();
        left = $(this).scrollLeft();
    });

    body.mousemove(function (e) {
        if (down) {
            var newX = e.pageX;
            var newY = e.pageY;

            navigation.scrollTop(top - newY + y);
            navigation.scrollLeft(left - newX + x);
        }
    });

    body.mouseup(function (e) {
        down = false;
        e.preventDefault();
    });
}
