/**
 * Toggles dropdown-navigation in mobile-navigation
 */
$(document).ready(function () {
    var dropdown = $('[data-js="mobile-nav-dropdown-toggle"]');

    dropdown.on('click', function (e, obj) {
        e.preventDefault();

        // rotate icon
        var icon = $(this).find('.icon');
        toggleState(icon, 'rotate-0', 'rotate-180');

        // select dropdown
        var dropdownContent = $(this).next('[data-js="mobile-nav-submenu"]');

        // show or hide dropdown, depending on current state
        if (dropdownContent.css('display') === 'block') {
            dropdownContent.slideUp('slow');
            dropdownContent.toggleClass('mobile-navigation__submenu--open');
        } else {
            dropdownContent.slideDown('slow');
            dropdownContent.toggleClass('mobile-navigation__submenu--open');
        }

        return false;
    });
});


/**
 * Toggles the supermenu
 */
function toggleSupermenu() {
    // toggle the supermenu
    toggleState('[data-js="supermenu"]', 'closed', 'open');

    // disabled active state of tab when the menu-tab is clicked.
    // We do this because we have to remember that this tab is active, when the menu is closed again.
    $('.nav-general__item.nav-general__item--active').toggleClass('nav-general__item--disable-active');

    // We toggle active state on menu tab
    $('[data-js="supermenu-toggle"]').toggleClass('nav-general__item--active');

    // toggle the menu-burger to be a cross
    toggleState('[data-js="bar-top"]', 'bar-top-transformed', '');
    toggleState('[data-js="bar-middle"]', 'bar-middle-transformed', '');
    toggleState('[data-js="bar-bottom"]', 'bar-bottom-transformed', '');
}


/**
 * This function can be called to initiate the parallax effect for an element. It can be used on multiple elements on one page.
 *
 * Example-use (image-foreground has parallax-effect, image-background is fixed):
 * <img class="image-foreground" src="xx/xx/xx.jpg" onload="scrollParallax()" data-type='parallax' data-parallax-intensity="7.5">
 * <img class="image-background" src="xx/xx/xy.jpg">
 *
 * Important: There should be an onload-event on the parallax-elements, so that the positioning is correct!
 *
 * Also there should be an on-scroll-event, which, triggers the effect while scrolling:
 * $(window).scroll(function()
 * {
 *     scrollParallax();
 * });
 *
 * data-parallax-intensity defines, how visible the parallax-effect is. The higher the number, the less visible the effect is.
 *
 */

var scrollParallax = function () {

    var layers, movement, translate3d, scrolledHeight, parallaxIntensity;
    layers = $('[data-type="parallax"]');
    scrolledHeight = window.pageYOffset + 500;

    layers.each(function () {
        parallaxIntensity = $(this).data('parallax-intensity');
        movement = -(scrolledHeight - $(this).offset().top) / parallaxIntensity;
        translate3d = 'translate3d(0, ' + movement + 'px, 0)';
        $(this).css({
            '-webkit-transform': translate3d,
            '-moz-transform': translate3d,
            '-ms-transform': translate3d,
            '-o-transform': translate3d,
            'transform': translate3d
        });
    });
};
