/**
 * Get UTM parameter from url
 * @param theParameter, name of the parameter you want to get
 * @returns If cookie value is set, return the value, else return false
 */
function getParameter(theParameter) {
    var params = window.location.search.substr(1).split('&');
    for (var i = 0; i < params.length; i++) {
        var p=params[i].split('=');
        if (p[0] == theParameter) {
            return decodeURIComponent(p[1]);
        }
    }
    return false;
}

/**
 * Set cookie with utm parameters, when available.
 * The cookie will have a lifetime of 30 days.
 * If there is no cookie saved, a new will be created. An already existing cookie will be updated.
 *
 * If a gclid is available -> Set utm_source to 'google' and store gclid in utm_content. Other utm_parameters will be ignored!
 *
 * 	 *	Please note the following priority:
 *		- If gclid is available, so 'source' will be 'google' and 'content' will have the gclid. They cannot be overridden by other parameters!
 *		- 'ut'-parameter before 'utm'-parameter
 */
function setUtmCookie() {
    // Get values form 'ut' params
    var ut_source = getParameter('ut_source');
    var ut_medium = getParameter('ut_medium');
    var ut_campaign = getParameter('ut_campaign');
    var ut_term = getParameter('ut_term');
    var ut_content = getParameter('ut_content');

    // Get values from 'utm' params
    var utm_source = getParameter('utm_source');
    var utm_medium = getParameter('utm_medium');
    var utm_campaign = getParameter('utm_campaign');
    var utm_term = getParameter('utm_term');
    var utm_content = getParameter('utm_content');

    // Get gclid param
    var gclid = getParameter('gclid');

    // Create object for new cookie
    var cookie = new Object();
    // Enable JSON support
    $.cookie.json = true;

    // Check if at least one parameter exists in URL, then create cookie
    if((gclid !== false || utm_source !== false || utm_medium !== false || utm_campaign !== false || utm_content !== false || utm_term !== false
        || ut_source !== false || ut_medium !== false || ut_campaign !== false || ut_content !== false || ut_term !== false)) {

        if(gclid !== false) {
            cookie.source = 'google';
        } else {
            if (ut_source !== false) {
                cookie.source = ut_source;
            } else if (utm_source !== false) {
                cookie.source = utm_source;
            }
        }

        if(gclid !== false) {
            // Do nothing
        } else {
            if (ut_medium !== false) {
                cookie.medium = ut_medium;
            } else if (utm_medium !== false) {
                cookie.medium = utm_medium;
            }
        }

        if(gclid !== false) {
            // Do nothing
        } else {
            if (ut_campaign !== false) {
                cookie.campaign = ut_campaign;
            } else if(utm_campaign !== false) {
                cookie.campaign = utm_campaign;
            }
        }

        if(gclid !== false) {
            cookie.content = gclid;
        } else {
            if (ut_content !== false) {
                cookie.content = ut_content;
            } else if (utm_content !== false) {
                cookie.content = utm_content;
            }
        }

        if(gclid !== false) {
            // Do nothing
        } else {
            if (ut_term !== false) {
                cookie.term = ut_term;
            } else if (utm_term !== false) {
                cookie.term = utm_term;
            }
        }

        $.cookie('utm_parameter', cookie, { expires: 30, path: '/', domain: 'qr-code-generator.com' } );
    }
}

/**
 * This function is called on document ready and will crop the page after 4 rows. The user can click on a button,
 * which will display the rest of the rows.
 * The displaying of the rows is done by .css(...), because with other functions there are issues with Lazyloading.
 */
function setQRForPageSeperator() {
    if ($(window).width() > 991) {
        // show only the first 4 rows
        $('[data-js="content-row"]').slice(0, 4).css('visibility', 'visible');
        $('[data-js="content-row"]').slice(4, 10).css('display', 'none');
    } else {
        // show all rows
        $('[data-js="content-row"]').slice(0, 10).css('visibility', 'visible');
    }

    $('[data-js="load-more-btn"]').on('click', function (e) {
        e.preventDefault();
        $('[data-js="content-row"]').slice(0, 10).slideDown();
        $('[data-js="content-row"]').slice(4, 10).css('visibility', 'visible');
        $('[data-js="content-row"]').slice(4, 10).css('display', 'flex');
        $('[data-js="load-more"]').fadeOut('slow');
        playQRForVideo(); //for loading the first video after slice
        scrollParallax(); //for repositioning of the hidden parallax images to prevent stuttering
    });
}


/**
 * Function which checks, whether the given element is in view.
 *
 * @param elem
 * @returns {boolean}
 */
function isScrolledIntoView(elem) {
    var docViewTop = $(window).scrollTop() + 100;
    var docViewBottom = docViewTop + $(window).height();

    var elemTop = $(elem).offset().top;
    var elemBottom = elemTop + $(elem).height();

    return ((elemBottom <= docViewBottom) && (elemTop >= docViewTop));
}

/**
 * If a video-element is in view (or not faded out) and hasn't played before, we will play it and add class "has-played"
 */
function playQRForVideo() {
    $('video').each(function () {
        if (!$(this).hasClass('has-played')
            && $(this).closest('[data-js="content-row"]').is(':visible')
            && !$(this).closest('[data-js="content-row"]').next('[data-js="content-row"]').is(':hidden')
            && isScrolledIntoView(this)) {

            $(this)[0].play();
            $(this).addClass('has-played');
        }
    })
}

$(document).ready(function () {

    // set the seperator on the page
    setQRForPageSeperator();

    // replays the video and hides replay-button
    $('[data-js="content-row-replay-btn"]').click(function () {
        $(this).closest('div').prev()[0].play();
        $(this).parent().css('visibility', 'hidden');
    })

});


var userScrolling = 0;
$(window).scroll(function () {

    //plays the videos on the page / variable "userscroll" prevents firing of the function on document-load
    if (userScrolling > 0) {
        playQRForVideo();
    }
    userScrolling++;

});

$( document ).ready(function() {

    //we play the video, if it is in viewport, when page is loaded.
    $( '[data-js="content-row-video"]' ).each( function() {

        //fix stuttering when video in view on pageload.
        scrollParallax();
        if (isScrolledIntoView($(this))) {
            playQRForVideo();
        }
    })

});
